import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import axios from "axios";

import { MyContextProvider } from "./MyContext";
import Layout from "./pages/Layout";
import Landing from "./pages/Landing";
import Login from "./pages/Login";
import SignUp from "./pages/SignUp";
import BalanceManager from "./pages/BalanceManager";
import NewTransaction from "./pages/NewTransaction";
import TransactionUpdater from "./pages/TransactionUpdater";
import TransactionManager from "./pages/TransactionManager";
import NewBalance from "./pages/NewBalance";

axios.defaults.baseURL = "http://127.0.0.1:3001";

function App() {
    // Placeholder for user_id (can also be fetched from context if already set globally)
    const user_id = 1; // Replace this with actual logic if available

    // Placeholder refreshTransactions function
    const refreshTransactions = () => {
        console.log("Refreshing transactions...");
        // Implement the actual transaction refresh logic here if necessary
    };

    return (
        <BrowserRouter>
            <MyContextProvider>
                <Routes>
                    <Route path="/" element={<Layout />}>
                        <Route index element={<Landing />} />
                        <Route path="/login" element={<Login />} />
                        <Route path="/signup" element={<SignUp />} />
                        <Route path="/balancemanager" element={<BalanceManager />} />
                        <Route path="/newtransaction" element={<NewTransaction />} />
                        <Route
                            path="/update-transaction/:transactionId"
                            element={
                                <TransactionUpdater
                                    refreshTransactions={refreshTransactions}
                                    user_id={user_id}
                                />
                            }
                        />
                        <Route path="/transactionmanager" element={<TransactionManager />} />
                        <Route path="/newbalance" element={<NewBalance />} />
                    </Route>
                </Routes>
            </MyContextProvider>
        </BrowserRouter>
    );
}

export default App;
